description:
A guy looking to find employment and marry the love of his life, gets in over his head when a fast-talking temp agent lands him a job.

When unemployed Bubba Brady gets a tip from a drifter named Jim about a job offer by Perriman, Bubba's girl Joy is thrilled - it means they can finally start a life. But the job is not as advertised; though the opportunity is real, Bubba will have to learn if he has the killer instincts to do what it requires...

